import React from "react";
import ReactDOM from "react-dom";
import Service from "./Service";
class Services extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div style={{ backgroundColor: "#f8f9fa" }} className="pt-5 pb-5">
        <div className="container">
          <div className="row justify-content-center">
            <h2 className="h1 text-muted  font-weight-bold"> Services</h2>
          </div>
          <p className="text-center">
            {" "}
            This is just a describing paragraph, dont mind it, it doesnt
            important at all
          </p>
          <div className="row">
            <Service />
            <Service />
            <Service />
            <Service />
            <Service />
            <Service />
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
